DEBUG - 2018-08-03 15:16:37 --> SELECT `ventas`.`id_venta`, `venta_articulos`.`id_articulo`, `ventas`.`fecha`, `ventas`.`articulos_vendidos`, `subtotal`, `total`, `observaciones`, `venta_articulos`.`cantidad`, `venta_articulos`.`precio_compra`, `venta_articulos`.`precio`, `productos`.`descripcion` as `producto`, `servicios`.`descripcion` as `servicio`, `promociones`.`descripcion` as `promocion`, CONCAT(persona.nombre, ' ', `persona`.`apellido_paterno`, ' ', persona.apellido_materno) as cliente
FROM `ventas`
JOIN `persona` ON `persona`.`id_persona` = `ventas`.`id_cliente`
JOIN `venta_articulos` ON `venta_articulos`.`id_venta` = `ventas`.`id_venta`
LEFT JOIN `productos` ON `productos`.`id_producto` = `venta_articulos`.`id_articulo`
LEFT JOIN `servicios` ON `servicios`.`id_servicio` = `venta_articulos`.`id_articulo`
LEFT JOIN `promociones` ON `promociones`.`id_promo` = `venta_articulos`.`id_articulo`
WHERE `ventas`.`fecha` >= '2018-08-03'
AND `ventas`.`fecha` <= '2018-08-03'
ORDER BY `venta_articulos`.`id_venta`
